import React from "react";
import styles from "./forrad.module.scss";
import Link from "next/link";

export default function index() {
  return (
    <main className={styles.main}>
      <div className={styles.wrapper}>
        {/* <img className={styles.containerImg} src="static/images/container.svg" alt="SB Fastigheter logo" /> */}
        <h1 className={styles.h1}>Hyr Containerförråd</h1>
        <h3 className={styles.h3}>Välj en plats</h3>
        <select className={styles.select} name="location">
          <option value="Eskilstuna">--</option>
          <option value="Eskilstuna">Västerås</option>
          <option value="Eskilstuna">Eskilstuna</option>
        </select>
      </div>
    </main>
  );
}
